import React from 'react';
import logo from './logo.svg';
import 'antd/dist/antd.css';
import './App.css';
import { Select } from 'antd';

const { Option } = Select;


function App() {

  function handleChange(value) {
    console.log(`selected ${value}`);
  }

  return (
    <div className="App" style={{ marginTop: 100, marginLeft:200}}>
      <header className="App-header">
        <p style={{textAlign: 'left'}}>Elenco Campagne</p>
        <div style= {{ background: 'grey', marginTop: 5}}>
            <Select 
              defaultValue="Tutte le campagne" 
              style={{ width: 1000}} 
              onChange={handleChange}>
              <Option value="Campagna 1">Campagna 1</Option>
              <Option value="Campagna 2">Campagna 2</Option>
              <Option value="Campagna 3">Campagna 3</Option>
            </Select>
            </div>
      </header>
    </div>
  );
}

export default App;
